import React from 'react'
import './header.css'
import { Container, Row, Button } from "reactstrap"
import { NavLink, Link } from 'react-router-dom'
export const Header = () => {
  const nav_links = [
    {
      path: '/home',
      display: "Home"
    },
    {
      path: '/seller',
      display: "Seller"
    },
    {
      path: '/becomeSeller',
      display: "BecomeSeller"
    }
  ]
  return (
    <header className='header'>
      <Container>
        <Row></Row>
      </Container>

    </header>
  )
}
